import './App.css';
import NavBar from './components/NavBar';
import Home from './components/Home';
import Footer from './Footer';

function App() {
  return (
    <div className="App" id='app'>
      <div id='top-panel'>
        <NavBar/>
        <Home/>
      </div>
    </div>
  );
}

export default App;
